/* 检查问卷是否存在
* @accept`surveyId`: 需要检测的 surveyId */
export async function checkSurvey(surveyId){
	const checkResp = await fetch(`http://localhost:1337/api/surveys/${surveyId}`);
	if(!checkResp.ok){
		return {
			isValid:false
		};
	}
}
